import React from 'react';
import { string, func, number } from 'prop-types';

export default function Select({
  id,
  onChange,
  value,
  textLabel,
}) {
  return (
    <label
      htmlFor={ id }
    >

      { textLabel }

      <input
        data-testid={ id }
        // name={ name }
        id={ id }
        value={ value }
        onChange={ onChange }
      />

    </label>
  );
}

Select.propTypes = {
  id: string.isRequired,
  // name: string,
  onChange: func.isRequired,
  value: string || number,
  textLabel: string,
};

Select.defaultProps = {
  // name: '',
  value: '',
  textLabel: '',
};
